import React from 'react';
import './App.css';

function App() {
	return (
		<div className="App">
			<table className="titleBar">
				<tbody>
					<tr>
						<td>
							<img alt="app icon" width="50" src="green_app_icon.svg" />
						</td>
						<td width="8">
							<h1>Movies Search</h1>
						</td>
					</tr>
				</tbody>
			</table>
		</div>
	);
}

export default App;
